import React, {Component} from "react"
import './style.css'

class MemeGenerator extends Component{
  constructor(){
    super()
    this.state = {
      topText: "",
      bottomText: "",
      allMemeImages: ["data:image/jpeg;base64,",

      // "data:image/jpeg;base64,",

      "data:image/jpeg;base64,"

    ,

      "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQFv3-q1Seaxtng1gAzA3X5n8aYZayk_HBsjNU-GEv2QOwZ6YTMZg&s",

      "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcR45eNPDafbuEWV_PEsTvpyqwK5aavtgBeh9tekxIHK1xgGcOtW&s",

      "data:image/jpeg;base64,",

      "data:image/jpeg;base64,",

      "data:image/jpeg;base64,",

      "data:image/jpeg;base64,"

    ],

      randomImg: "data:image/jpeg;base64,"
    }

    this.handleChange = this.handleChange.bind(this)
    this.handleSubmit = this.handleSubmit.bind(this)
  }

  componentDidMount(){
    fetch("data:image/jpeg;base64,")
    .then(response => response.json())
    .then(response => {
      const {memes} = response.data
      console.log(memes[0])
      this.setState({ allMemeImages : memes})
    })
  }

  handleChange(event){
    const {name, value} = event.target
    this.setState({ [name] : value })
  }

  handleSubmit(event){
    event.preventDefault()
    const Image = Math.floor(Math.random() * this.state.allMemeImages.length);
    const randomImage = this.state.allMemeImages[Image]
    this.setState({randomImg: randomImage})

  }




  render(){
    // const randomImg = Math.floor(Math.random() * 4);

    return(
      <div>
        <h1 className="title"> MEME GENERATOR </h1>
        <form onSubmit={this.handleSubmit}>

        <input className="input"
          type = "text"
          name = "topText"
          placeholder = "Top Text"
          value = {this.state.topText}
          onChange = {this.handleChange}
        />

        <input className="input"
          type = "text"
          name = "bottomText"
          placeholder = "Bottom Text"
          value = {this.state.bottomText}
          onChange = {this.handleChange}
        />
        <button className="button">Generate</button>


        </form>

        <div>
          <img className="meme" src= {this.state.randomImg} alt="" vspace="50" />
          <h2 className="inputTop"> {this.state.topText} </h2>
          <h2 className="inputBottom"> {this.state.bottomText} </h2>
        </div>

      </div>
    )
  }
}

export default MemeGenerator
